    let lastValidMieternummer = "";
    let isUserTyping = false;

    function updateSignFields() {
        document.getElementById("strasseeinzugsign").textContent = document.getElementById("strasseeinzug").value;
        document.getElementById("plzeinzugsign").textContent = document.getElementById("plzeinzug").value;
        document.getElementById("lageeinzugsign").textContent = document.getElementById("lageeinzug2").value;
        document.getElementById("datumsign").textContent = document.getElementById("datum").value;
    }

    function fillFieldsByMieternummer(mieterId) {
        const found = strassen.find(strasse =>
            strasse.mieternummer.toLowerCase() === mieterId.toLowerCase()
        );

        if (found) {
            document.getElementById("strasseeinzug").value = found.objekt;
            document.getElementById("plzeinzug").value = `${found.plz} ${found.ort}`;
            document.getElementById("lageeinzug2").value = found.lage;
            lastValidMieternummer = mieterId;
            updateSignFields();
        } else if (mieterId.length === 0) {
            document.getElementById("strasseeinzug").value = "";
            document.getElementById("plzeinzug").value = "";
            document.getElementById("lageeinzug2").value = "";
            lastValidMieternummer = "";
            updateSignFields();
        }
    }

    function showSuggestions(input, suggestionElement, isMieternummerSearch) {
        // 1. Reset
        const inputValue = input.value.toLowerCase();
        suggestionElement.innerHTML = "";

        // 2. Temporär an body anhängen
        document.body.appendChild(suggestionElement);

        // 3. Position berechnen
        const rect = input.getBoundingClientRect();
        suggestionElement.style.top = `${rect.bottom + window.scrollY}px`;
        suggestionElement.style.left = `${rect.left + window.scrollX}px`;
        suggestionElement.style.width = `${rect.width}px`;

        // 4. Einträge filtern/erstellen
        const suggestions = strassen.filter(strasse =>
            isMieternummerSearch
                ? strasse.mieternummer.toLowerCase().includes(inputValue)
                : strasse.objekt.toLowerCase().includes(inputValue)
        );

        suggestions.forEach(strasse => {
            const option = document.createElement("div");
            option.className = "suggestion-item";
            option.textContent = isMieternummerSearch ? strasse.mieternummer : strasse.objekt;
            option.onclick = () => {
                input.value = option.textContent;
                if (isMieternummerSearch) fillFieldsByMieternummer(strasse.mieternummer);
                suggestionElement.style.display = "none";
                input.closest('.suggestion-container').appendChild(suggestionElement);
                input.focus();
            };
            suggestionElement.appendChild(option);
        });

        // 5. Anzeigen/Verstecken
        suggestionElement.style.display = suggestions.length > 0 ? "block" : "none";

        // In der showSuggestions-Funktion:
        option.style.whiteSpace = 'nowrap';
        option.style.overflow = 'hidden';
        option.style.textOverflow = 'ellipsis';
        option.style.width = '100%';
    }

